import React from 'react';
import AWSArchitectureGame from './components/AWSArchitectureGame';
import './styles/App.css';
import './styles/AWSArchitecture.css';

function App() {
  return (
    <div className="app">
      <header className="app-header">
        <h1>AWS Architecture Challenge</h1>
      </header>
      <main>
        <AWSArchitectureGame />
      </main>
    </div>
  );
}

export default App;
